import React from 'react';
import { Container } from './styles';
import { ProductList, IconBentcare } from '@bentcare/core';

const data = [
  { description: 'Vitamina D-25 Hidroxi', price: '46,80' },
  { description: 'TSH - Hormônio', price: '14,40' },
  { description: 'Glicose', price: '5,40' },
  { description: 'Hemograma Completo', price: '9,00' },
  { description: 'Colesterol Total', price: '25,20' },
];

const ThirdSection: React.FC = () => {
  return (
    <Container>
      <div className="title">
        <h2>Exames laboratoriais que cabem em seu bolso</h2>
        <p>
          Compare preços e encontre os melhores exames laboratoriais de sua
          região
        </p>
      </div>
      <div>
        <ProductList
          card={true}
          fullWidth={false}
          title="Exames"
          icon={<IconBentcare icon="exam" />}
        />
      </div>
    </Container>
  );
};

export default ThirdSection;
